import React from "react";

const FontAwesome = () => {
  const icons = [
    "fa-address-book", "fa-user", "fa-home", "fa-cog", "fa-search",
    "fa-envelope", "fa-heart", "fa-star", "fa-check", "fa-times",
    "fa-plus", "fa-minus", "fa-edit", "fa-trash", "fa-download",
    "fa-upload", "fa-lock", "fa-unlock", "fa-bell", "fa-calendar"
  ];

  return (
    <>
      <div className="page-header">
        <h3 className="page-title">
          <span className="page-title-icon bg-gradient-primary text-white me-2">
            <i className="mdi mdi-emoticon"></i>
          </span>
          Font Awesome Icons
        </h3>
      </div>

      <div className="row">
        <div className="col-lg-12 grid-margin">
          <div className="card">
            <div className="card-body">
              <h4 className="card-title">Basic Icons</h4>
              <p className="card-description">
                Use <code>&lt;i className="fa fa-icon-name"&gt;&lt;/i&gt;</code>
              </p>

              <div className="row">
                {icons.map((icon, index) => (
                  <div key={index} className="col-sm-6 col-md-4 col-lg-3 mb-4">
                    <i className={`fa ${icon} me-2`} style={{ fontSize: "20px" }}></i>
                    {icon}
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default FontAwesome;
